import { Routes, Route } from "react-router-dom";
import Home from './Home';
import Join from './Join';

function App() {
  return (

    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/join" element={<Join />} />
    </Routes>

  );
}

export default App;
